        </Route>
        <Route path="/decks/:deckId">
          {/* nested routing continues in Deck component */}
          <Deck decks={decks} setLoading={setLoading} setError={setError} />
        </Route>
        <Route>
          <NotFound />
        </Route>
      </Switch>
